import React, { useState } from "react";
import "./CreateAssociado.css";
import TextField from '@mui/material/TextField';
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import { useNavigate } from 'react-router-dom';
import Snackbar from '@mui/material/Snackbar';
import Alert from '@mui/material/Alert';

const CreateAssociado = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    login: '',
    senha: '',
    nome: '',
    cpf: '',
    email: '',
    dataDeNascimento: ''
  });

  const [snackbarOpen, setSnackbarOpen] = useState(false);
  const [snackbarMessage, setSnackbarMessage] = useState('');
  const [snackbarSeverity, setSnackbarSeverity] = useState('success'); // Pode ser 'success' ou 'error'

  const handleChange = (campo) => (event) => {
    setFormData({ ...formData, [campo]: event.target.value });
  };

  const salvar = async () => {
    try {
      const response = await axios.post('http://localhost:8080/api/associado', formData);
      console.log(response);
      setSnackbarMessage('Cadastro realizado com sucesso!');
      setSnackbarSeverity('success');
      setSnackbarOpen(true);
    } catch (error) {
      console.log(error.response);
      setSnackbarMessage('Erro ao realizar o cadastro!');
      setSnackbarSeverity('error');
      setSnackbarOpen(true);
    }
    console.log('request finished');
  };

  const cancel = () => {
    console.log('cancel');
  };

  const goToAdvogado = () => {
    navigate("/sessao/createAdvogado");
  };

  const goToCliente = () => {
    navigate("/sessao/createCliente");
  };

  const handleCloseSnackbar = () => {
    setSnackbarOpen(false);
  };

  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-12">
          <div className="bs-component">
            <div style={{ marginTop: '70px' }}>
              <ButtonGroup variant="contained" aria-label="Basic button group">
                <Button style={{ backgroundColor: 'white', color: 'grey' }} onClick={goToCliente}>Cliente</Button>
                <Button style={{ backgroundColor: 'white', color: 'grey' }} onClick={goToAdvogado}>Advogado</Button>
                <Button style={{ backgroundColor: 'grey' }}>Associado</Button>
              </ButtonGroup>
              <div style={{ width: 1100, height: 470, background: 'white', border: '2px #838383 solid' }}>
                <div style={{ width: 325, height: 50, color: '#838383', fontSize: 27, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', marginTop: '15px', marginLeft: '90px' }}>Dados pessoais</div>
                <div style={{ marginTop: '35px', marginLeft: '50px' }}>
                  <div style={{ width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>LOGIN</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    value={formData.login}
                    onChange={handleChange('login')}
                  />

                  <div style={{ marginTop: '12px', width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>SENHA</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    type="password"
                    value={formData.senha}
                    onChange={handleChange('senha')}
                  />

                  <div style={{ marginTop: '12px', width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>NOME</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    value={formData.nome}
                    onChange={handleChange('nome')}
                  />

                  <div style={{ position: 'relative', left: 680, top: -250, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>CPF</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px', left: 680, top: -220 }}
                    value={formData.cpf}
                    onChange={handleChange('cpf')}
                  />

                  <div style={{ position: 'relative', left: 680, top: -210, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>EMAIL</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px', left: 680, top: -180 }}
                    value={formData.email}
                    onChange={handleChange('email')}
                  />
                </div>

                <div style={{ position: 'relative', left: 780, top: -170, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>DATA DE NASCIMENTO</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    type="date"
                    style={{ marginTop: '-15px', width: '250px', left: 680, top: -140 }}
                    value={formData.dataDeNascimento}
                    onChange={handleChange('dataDeNascimento')}
                  />

                <div style={{ marginTop: '39px' }}>
                  <Button onClick={cancel} variant="contained" style={{ width: 120, height: 40, backgroundColor: 'grey' }}>Cancelar</Button>
                  <Button onClick={salvar} variant="contained" style={{ width: 120, height: 40, backgroundColor: 'grey', marginLeft: '850px' }}>Salvar</Button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Snackbar open={snackbarOpen} autoHideDuration={6000} onClose={handleCloseSnackbar}>
        <Alert onClose={handleCloseSnackbar} severity={snackbarSeverity} sx={{ width: '100%' }}>
          {snackbarMessage}
        </Alert>
      </Snackbar>
    </div>
  );
};

export default CreateAssociado;
